import React from 'react';

import './MainPageStyle.css';
import { C_Icon } from '../core/Components';
import {Clients} from '../clients/Clients';

export class MainPage extends React.Component {
    constructor(props) {
        super(props);

        this.openClients = this.openClients.bind(this);


        this.state = {
            openClients: false,
        }
    }

    openClients(){
        this.setState({openClients: true});
    }

    render(){
        
        return(
            <div>

               
    
                <div className="body">
                    {this.state.openClients ? 
                        <Clients />                    
                    : undefined}
                </div>
    
              
            </div>
        );
    };
}
